import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TimeElapsed = () => {
  const [startTime, setStartTime] = useState(null);
  const [elapsedTime, setElapsedTime] = useState(null);

  useEffect(() => {
    const interval = setInterval(() => {
      const now = new Date();
      if (startTime) {
        const elapsed = now - startTime;
        setElapsedTime(elapsed);
      }
    }, 1000); // Update every second

    return () => clearInterval(interval);
  }, [startTime]);

  return <div>Elapsed Time: {elapsedTime ? (elapsedTime / 1000).toFixed(2) : 0} seconds</div>;
};

const Index = () => {
  const [startRange, setStartRange] = useState('');
  const [endRange, setEndRange] = useState('');
  const [primeNumbers, setPrimeNumbers] = useState([]);
  const [algorithmType, setAlgorithmType] = useState('');
  const [primeCount, setPrimeCount] = useState(0);
  const [primeRecords, setPrimeRecords] = useState([]);

  useEffect(() => {
    handleGetPrimeRecords();
  }, []);

  const handleGetPrimeRecords = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/data');
      setPrimeRecords(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };
  
  const handleclick = async () => {
    try {
      handleGenerate();
      const response = await axios.post('http://localhost:3001/api/data', {
        start: startRange,
        end: endRange,
        algorithm: algorithmType,
        numPrimes: primeCount,
      });
      console.log(response);
     
    } catch (error) {
      if (error.response) {
        console.log('Server Error:', error.response.data);
      } else if (error.request) {
        console.log('No response received from server:', error.request);
      } else {
        console.log('Error:', error.message);
      }
    }
  };
  
  

  const handleGenerate = async () => {
    const start = parseInt(startRange);
    const end = parseInt(endRange);

    if (isNaN(start) || isNaN(end) || start >= end) {
      alert('Please enter valid start and end range!');
      return;
    }

    const primes = [];
    let count = 0;

    for (let i = start; i <= end; i++) {
      if (isPrime(i)) {
        primes.push(i);
        count++;
      }
    }

    setPrimeNumbers(primes);
    setPrimeCount(count);
  };

  const isPrime = (num) => {
    if (num <= 1) return false;
    if (num <= 3) return true;

    if (num % 2 === 0 || num % 3 === 0) return false;

    let i = 5;
    while (i * i <= num) {
      if (num % i === 0 || num % (i + 2) === 0) return false;
      i += 6;
    }

    return true;
  };

  return (
    <div>
      <form>
        <div>
          <div className='text-white font-sm'>hey</div>
          <label className='text-yellow'>Enter the starting range:</label>
          <input type="number" name="start" value={startRange} onChange={(e) => setStartRange(e.target.value)} />
        </div>
        <div>
          <label>Enter the ending range:</label>
          <input type="number" name="end" value={endRange} onChange={(e) => setEndRange(e.target.value)} />
        </div>
        <div>
          <label>Enter the algorithm type:</label>
          <input type="text" name="algorithm" value={algorithmType} onChange={(e) => setAlgorithmType(e.target.value)} />
        </div>
        <button type="button" onClick={() => handleclick()}>
          Generate
        </button>
      </form>
      <div>
        <h2>Prime numbers between {startRange} and {endRange}:</h2>
        <p>Algorithm used: {algorithmType}</p>
        <p>Count of prime numbers: {primeCount}</p>
        <ul>
          {primeNumbers.map((num, index) => (
            <li key={index}>{num}</li>
          ))}
        </ul>
      </div>
      <div>
        <button type="button" onClick={() => handleGetPrimeRecords()}>
          Get Prime Records
          <ul>
          {primeRecords.map((record, index) => (
          <li key={index}>
            <p>Date: {record.Date}</p>
            <p>Start: {record.start}</p>
            <p>End: {record.end}</p>
            <p>Algorithm: {record.algorithm}</p>
            <p>Elapsed time:</p> {/* Move TimeElapsed outside of p */}
            <TimeElapsed />
          </li>
        ))}
          </ul>
        </button>
      </div>
    </div>
  );
};

export default Index;
